/**
* Author(s) of this code: 
*
* Joven Manikiza
*/

import { Main, Heading, SectionBreak, Breadcrumbs,
     Paragraph, Button, GridCol,GridRow } from "govuk-react";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Navigation from "../../../Navigation";

function AddressChangeDetails(){

    const navigate = useNavigate();

    const [data, setData] = useState({});

  useEffect(() => {
    fetch('http://localhost:4000/getData.php')
      .then(response => response.json())
      .then(data => {
        setData({
        forename: data[0].Forename,
        surname: data[0].Surname,
        NHSNo: data[0].NHSNumber,
        address: data[0].Postcode,
        });
      })
      .catch(error => console.error(error));
  }, []);
    return (
        <div>
            <Navigation pageLink1="/" PageName1="home" pageLink2="/login" PageName2="Login" pageLink3="/NhsNumber" PageName3="Register"/>

            <Main>

                <Breadcrumbs>
                    <Breadcrumbs.Link>Home Page</Breadcrumbs.Link>
                    <Breadcrumbs.Link>Profile</Breadcrumbs.Link>
                    <Breadcrumbs.Link>Start</Breadcrumbs.Link>
                </Breadcrumbs>
                
                <Heading>About you</Heading>



<Table>
  <Table.Row>
    <CellHeader>
        NHS number:
    </CellHeader>
    <Table.Cell>
      {data.NHSno}
    </Table.Cell>
  </Table.Row>
  <Table.Row>
    <CellHeader>
      First name:
    </CellHeader>
    <Table.Cell>
      {data.forename}
    </Table.Cell>
  </Table.Row>
  <Table.Row>
    <CellHeader>
      Last name:
    </CellHeader>
    <Table.Cell>
      {data.surname}
    </Table.Cell>
  </Table.Row>
  <Table.Row>
    <CellHeader>
    Current Address:
        </CellHeader>
    <Table.Cell>
        {data.address}
    </Table.Cell>
  </Table.Row>
</Table>
              



                <Button onClick={() => navigate("/AddressChangeEnter")}>
                    Continue
                </Button>

                 <SectionBreak level="SMALL" visible={false}/>
                
                <Button onClick={() => navigate("/Profile")} buttonColour="GREY">
                    Cancel
                </Button>                


            </Main>
        </div>
    );

}

export default AddressChangeDetails;
